// src/pages/Dashboard.js - Versione avanzata
import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Container, 
  Grid, 
  Card, 
  CardContent, 
  Paper, 
  Tabs, 
  Tab, 
  Divider, 
  Chip,
  CircularProgress,
  useTheme,
  Avatar,
  CardHeader,
  CardActions,
  Button,
  IconButton,
  Fade,
  Grow
} from '@mui/material';
import Header from '../components/common/Header';
import Sidebar from '../components/common/Sidebar';
import ProfileSection from '../components/profile/ProfileSection';
import MultiAgentSection from '../components/multiagent/MultiAgentSection';
import AliSection from '../components/ali/AliSection';
import AgentsSection from '../components/agents/AgentsSection';
import DocumentUploader from '../components/common/DocumentUploader';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import InsightsIcon from '@mui/icons-material/Insights';
import AssessmentIcon from '@mui/icons-material/Assessment';
import AutorenewIcon from '@mui/icons-material/Autorenew';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import { motion } from 'framer-motion';

const MotionCard = motion(Card);
const MotionBox = motion(Box);

function Dashboard() {
  const theme = useTheme();
  const [activeSection, setActiveSection] = useState('profile');
  const [loading, setLoading] = useState(true);
  const [tabValue, setTabValue] = useState(0);

  useEffect(() => {
    // Simulazione del caricamento iniziale
    const timer = setTimeout(() => setLoading(false), 1500);
    return () => clearTimeout(timer);
  }, []);

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const renderMainContent = () => {
    switch (activeSection) {
      case 'profile':
        return <ProfileContent />;
      case 'multiagent':
        return <MultiAgentSection />;
      case 'ali':
        return <AliSection />;
      case 'agents':
        return <AgentsSection />;
      case 'my-documents':
      case 'legal-analysis':
      case 'reports':
        return <DocumentUploader />;
      default:
        return <ProfileContent />;
    }
  };

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        duration: 0.5,
        when: "beforeChildren",
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: { type: "spring", stiffness: 100 }
    }
  };

  if (loading) {
    return (
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '100vh',
          flexDirection: 'column',
          bgcolor: theme.palette.background.default
        }}
      >
        <Box sx={{ position: 'relative', display: 'inline-flex' }}>
          <CircularProgress size={60} />
          <Box
            sx={{
              top: 0,
              left: 0,
              bottom: 0,
              right: 0,
              position: 'absolute',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
            }}
          >
            <img src="/logo.svg" alt="Valis Logo" height="30" />
          </Box>
        </Box>
        <Typography variant="h6" sx={{ mt: 2 }}>
          Caricamento Valis...
        </Typography>
      </Box>
    );
  }

  return (
    <MotionBox
      component={motion.div}
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      sx={{ 
        display: 'flex', 
        minHeight: '100vh',
        bgcolor: theme.palette.background.default
      }}
    >
      <Header />
      <Sidebar activeSection={activeSection} onSectionChange={setActiveSection} />
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          p: { xs: 2, md: 3 },
          mt: 8, // Spazio per l'header
          ml: { xs: 0, md: '260px' }, // Spazio per la sidebar su desktop
          width: { xs: '100%', md: 'calc(100% - 260px)' },
        }}
      >
        <Container maxWidth="xl">
          {renderMainContent()}
        </Container>
      </Box>
    </MotionBox>
  );
}

// Componente per il contenuto della sezione Profilo
function ProfileContent() {
  const theme = useTheme();
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    setIsLoaded(true);
  }, []);

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        when: "beforeChildren",
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: { type: "spring", stiffness: 100 }
    }
  };

  return (
    <motion.div
      variants={containerVariants}
      initial="hidden"
      animate={isLoaded ? "visible" : "hidden"}
    >
      <Typography variant="h4" gutterBottom component={motion.h4} variants={itemVariants}>
        Benvenuto in Valis
      </Typography>

      <Typography variant="subtitle1" color="textSecondary" gutterBottom sx={{ mb: 4 }} component={motion.p} variants={itemVariants}>
        Piattaforma legale con intelligenza artificiale multipla - Lexygraph AI
      </Typography>

      <Grid container spacing={3}>
        {/* Statistiche principali */}
        <Grid item xs={12} md={8} component={motion.div} variants={itemVariants}>
          <Paper 
            elevation={0} 
            variant="outlined" 
            sx={{ p: 0, borderRadius: 3, overflow: 'hidden' }}
          >
            <Box sx={{ 
              p: 2, 
              background: theme.palette.mode === 'dark' 
                ? 'linear-gradient(45deg, #3949ab 30%, #283593 90%)' 
                : 'linear-gradient(45deg, #3f51b5 30%, #303f9f 90%)',
              color: 'white'
            }}>
              <Typography variant="h6">Panoramica Attività</Typography>
              <Typography variant="body2">Ultima attività: 2 ore fa</Typography>
            </Box>

            <Box sx={{ p: 3 }}>
              <Grid container spacing={3}>
                <Grid item xs={12} sm={4}>
                  <Box textAlign="center" p={2}>
                    <Typography variant="h3" fontWeight="bold" color="primary">12</Typography>
                    <Typography variant="body2" color="textSecondary">Documenti Totali</Typography>
                  </Box>
                </Grid>
                <Grid item xs={12} sm={4}>
                  <Box textAlign="center" p={2}>
                    <Typography variant="h3" fontWeight="bold" color="primary">5</Typography>
                    <Typography variant="body2" color="textSecondary">Analisi in Corso</Typography>
                  </Box>
                </Grid>
                <Grid item xs={12} sm={4}>
                  <Box textAlign="center" p={2}>
                    <Typography variant="h3" fontWeight="bold" color="primary">3</Typography>
                    <Typography variant="body2" color="textSecondary">Agenti Attivi</Typography>
                  </Box>
                </Grid>
              </Grid>

              <Divider sx={{ my: 2 }} />

              <Typography variant="subtitle2" gutterBottom>Attività Recenti</Typography>

              <Box sx={{ mt: 2 }}>
                {['Contratto analizzato 30 minuti fa', 'Nuovo documento caricato 2 ore fa', 'Analisi completata 1 giorno fa'].map((activity, index) => (
                  <Box 
                    key={index} 
                    sx={{ 
                      display: 'flex', 
                      alignItems: 'center', 
                      py: 1,
                      borderBottom: index < 2 ? `1px solid ${theme.palette.divider}` : 'none'
                    }}
                  >
                    <CheckCircleIcon fontSize="small" color="success" sx={{ mr: 1.5 }} />
                    <Typography variant="body2">{activity}</Typography>
                  </Box>
                ))}
              </Box>
            </Box>
          </Paper>
        </Grid>

        {/* Profilo utente */}
        <Grid item xs={12} md={4} component={motion.div} variants={itemVariants}>
          <Card elevation={0} variant="outlined" sx={{ borderRadius: 3 }}>
            <CardHeader
              avatar={
                <Avatar 
                  sx={{ 
                    bgcolor: theme.palette.primary.main,
                    width: 56,
                    height: 56
                  }}
                >
                  U
                </Avatar>
              }
              title={
                <Typography variant="h6">Studio Legale</Typography>
              }
              subheader="Amministratore"
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" paragraph>
                Account professionale con accesso completo alla piattaforma Valis.
              </Typography>

              <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                <Typography variant="body2" color="textSecondary" sx={{ mr: 1 }}>
                  Livello accesso:
                </Typography>
                <Chip 
                  label="Premium" 
                  size="small" 
                  sx={{ 
                    bgcolor: theme.palette.mode === 'dark' ? '#ffab00' : '#f57c00',
                    color: 'white',
                    fontWeight: 'bold'
                  }} 
                />
              </Box>

              <Box sx={{ display: 'flex', alignItems: 'center' }}>
                <Typography variant="body2" color="textSecondary" sx={{ mr: 1 }}>
                  Stato:
                </Typography>
                <Chip 
                  label="Attivo" 
                  size="small"
                  color="success"
                  sx={{ fontWeight: 'medium' }}
                />
              </Box>
            </CardContent>
            <CardActions>
              <Button size="small" color="primary">Modifica Profilo</Button>
              <Button size="small" color="primary">Impostazioni</Button>
            </CardActions>
          </Card>
        </Grid>

        {/* Documenti recenti */}
        <Grid item xs={12} component={motion.div} variants={itemVariants}>
          <Typography variant="h6" gutterBottom>Documenti Recenti</Typography>
          <Grid container spacing={2}>
            {['Contratto di Locazione.pdf', 'Accordo Societario.docx', 'Parere Legale.pdf', 'Procura.pdf'].map((doc, index) => (
              <Grid item xs={12} sm={6} md={3} key={index}>
                <MotionCard 
                  elevation={0} 
                  variant="outlined"
                  whileHover={{ y: -5, boxShadow: theme.palette.mode === 'dark' ? '0 8px 16px rgba(0,0,0,0.4)' : '0 8px 16px rgba(0,0,0,0.1)' }}
                  sx={{ borderRadius: 2 }}
                >
                  <CardContent>
                    <Box display="flex" alignItems="center" justifyContent="space-between" mb={1}>
                      <Avatar
                        variant="rounded"
                        sx={{
                          bgcolor: doc.endsWith('.pdf') ? '#f44336' : '#2196f3',
                          width: 40,
                          height: 40
                        }}
                      >
                        {doc.endsWith('.pdf') ? 'PDF' : 'DOC'}
                      </Avatar>
                      <IconButton size="small">
                        <MoreHorizIcon fontSize="small" />
                      </IconButton>
                    </Box>
                    <Typography variant="subtitle2" noWrap title={doc}>
                      {doc}
                    </Typography>
                    <Typography variant="caption" color="textSecondary">
                      Modificato {index + 1} {index === 0 ? 'ora' : 'giorni'} fa
                    </Typography>
                  </CardContent>
                </MotionCard>
              </Grid>
            ))}
          </Grid>
        </Grid>

        {/* Caricamento documenti */}
        <Grid item xs={12} component={motion.div} variants={itemVariants}>
          <DocumentUploader />
        </Grid>
      </Grid>
    </motion.div>
  );
}

export default Dashboard;
